import React from "react";
import { useRouter } from "next/router";
// import Link from "next/link";
import Header from "components/Header/Header.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import classNames from "classnames";
import Box from "@material-ui/core/Box";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";

import { makeStyles } from "@material-ui/core/styles";
import styles from "assets/jss/nextjs-material-kit/pages/components.js";

const useStyles = makeStyles(styles);

const catgeory = props => {
  const router = useRouter();
  const { catgeory } = router.query;
  const classes = useStyles();

  const [data, setData] = React.useState({});
  console.log("props:", props, "router", router);

  const makeid = length => {
    var result = "";
    var characters =
      "ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789";
    var charactersLength = characters.length;
    for (var i = 0; i < length; i++) {
      result += characters.charAt(Math.floor(Math.random() * charactersLength));
    }
    return result;
  };

  const generateTopic = number => {
    var Topic = [];
    for (let index = 0; index < number; index++) {
      Topic.push({
        id: index,
        text: makeid(Math.floor(Math.random() * 80) + 2)
      });
    }
    return Topic;
  };

  const generateData = catgeory => {
    setData({
      catgeory: catgeory,
      topic: generateTopic(10)
    });
  };

  React.useEffect(() => {
    generateData(catgeory);
  }, []);

  console.log(data);

  return (
    <div>
      <Header
        brand="ANONMAS TH"
        rightLinks={<HeaderLinks />}
        fixed
        color="dark"
        // {...props}
      />
      <div className={classNames(classes.main, classes.mainRaised)}>
        <div style={{ width: "100%" }}>
          <Box component="span" display="block" p={3} m={3} />
        </div>
        <GridContainer justify="center" spacing={2}>
          <GridItem xs={5}>
            <Header brand={catgeory} color="primary" />
          </GridItem>
        </GridContainer>
      </div>
      <div style={{ width: "100%" }}>
        <Box component="span" display="block" p={10} m={10} />
      </div>
    </div>
  );
};

export default catgeory;
